          <div class="col-sm-12 col-md-6 col-lg-6">
            <h1 class="enterpriseTitleColor pt-5 mt-4">Coaching manager</h1>

            <p class="enterprisePara">Notre engagement est de libérer votre Leadership et celui de vos collaborateurs
              pour plus d’engagement, d’harmonie et d’épanouissement.<br>
              Découvrez l’efficacité de notre approche ciblée sur l’apprentissage, le développement et l’exploration de
              nouvelles pistes de management innovantes et créatives. Le tout au profit de la croissance de l’entreprise
              et de son évolution permanente face au contexte économique et concurrentiel.</p>
          </div>
        </div>
      </div>
    </section>

    <section class="Enterprise_off_sec_4">
      <div class="container">
        <div class="row">
          <div class="col-sm-12 col-md-6 col-lg-6">
            <h1 class="enterpriseTitleColor pt-5">Services de bien-être</h1>

            <p class="enterprisePara">Notre engagement est faire de l’entreprise un acteur positif du bien-être de
              chacun ! Alors faites bénéficier&nbsp;vos collaborateurs d’une offre bien-être sur des sujets du quotidien
              : Performance, nutrition, stress, posture.<br>
              La responsabilité du bien-être se partage entre tous les membres d’une organisation. Profitez de nos
              offres bien-être pour améliorer la qualité de vie au travail de vos collaborateurs, renforcer votre marque
              employeur et réduire l’absentéisme au travail.</p>
          </div>

